import React, {Component}from 'react';
import {Dropdown} from 'react-native-material-dropdown';
class App extends Component{
    render(){
        let data = [
            {
               value:'system Analyst' ,
            },
            {
                value:'software engineer',
            },
            {
                value:'admin',
            }
        ];
    }


}
export default App;
